import jsPDF from "jspdf";

(function (jsPDFAPI) {
   var font =
      "";
   var callAddFont = function () {
      this.addFileToVFS("JosefinSans-Light-normal.ttf", font);
      this.addFont(
         "JosefinSans-Light-normal.ttf",
         "JosefinSans-Light",
         "normal"
      );
   };
   jsPDFAPI.events.push(["addFonts", callAddFont]);
})(jsPDF.API);
